async def show_tip(ctx):
    if ctx.author.id in config.DEVS:
        return

    if random.randint(45, 69) == 69:
        with suppress(discord.HTTPException, discord.Forbidden):
            await ctx.send(f"**Did You Know?:** {random.choice(tips)}")

